INSERT INTO `tb_leave_msg` VALUES ('27', '朋友', '<wbr></wbr><wbr></wbr><br />\n<span style=\"line-height: 1.3em\"><wbr></wbr></span><span style=\"line-height: 1.3em\">特来看望朋友</span><wbr></wbr><span style=\"line-height: 1.3em\"><wbr></wbr></span><br />\n<span style=\"line-height: 1.3em\"><wbr></wbr>缘分，是上天赐给的<br />\n快乐，是自己寻找的<br />\n欢笑，是朋友带来的<br />\n幸福，是自己争取的<br />\n烦恼，用智慧自解的<br />\n祝愿你开心快乐无忧</span><wbr></wbr>', '2011-10-08 17:05:02');
