INSERT INTO `tb_leave_msg` VALUES ('31', '给大家介绍个好看的视频', '<a href=\"http://you.video.sina.com.cn/b/25210923-1335796895.html\">http://you.video.sina.com.cn/b/25210923-1335796895.html</a><br />\n<br />\n<p class=\"wordwrap\">一名到乡村支教的老师在第一天上课时，无意中的一个名词解释却深深伤害了一个山里孩子的自尊，于是她决定无论如何也要弥补自己的过失&hellip;&hellip;<br />\n本片曾入围101全球华人电影节专业组决赛。</p>', '2011-10-31 15:11:48');
