-- ----------------------------
-- Table structure for tb_userinfo
-- ----------------------------
DROP TABLE IF EXISTS `tb_userinfo`;
CREATE TABLE `tb_userinfo` (
  `id` int(4) NOT NULL,
  `login_id` int(4) DEFAULT NULL,
  `real_name` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `sex` bit(1) DEFAULT NULL,
  `birthday` varchar(10) COLLATE utf8_bin DEFAULT NULL,
  `email` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `birth_place` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `live_place` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `regist_time` varchar(19) COLLATE utf8_bin DEFAULT NULL,
  `last_login_time` varchar(19) COLLATE utf8_bin DEFAULT NULL,
  `introduce` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `loginid` (`login_id`),
  CONSTRAINT `loginid` FOREIGN KEY (`login_id`) REFERENCES `tb_login` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

